import React from "react";
import { View } from "react-native";
import { Switch, TextInput } from "react-native-gesture-handler";

export default function UrgentTimeline({ setQuery }) {
  return (
    <View
      style={{
        padding: 10,
        backgroundColor: "#ffffff",
        margin: 10,
        borderRadius: 30,
        borderWidth: 1,
        borderColor: "#BA181B",
      }}
    >
      <Button title="Urgent" onPress={(value) => setValue(value) } />
    </View>
  );
}


